import React from "react";

import Welcome from "./pages/Welcome";

const App = () => {
  return (
    <div>
      {/* <Welcome /> */}

      <div className="grid grid-rows-3 grid-cols-2 w-[14rem] mx-auto gap-3 mt-4">
        <div className="h-[106px]">
            <div className="w-full h-full border-4 rounded-full border-black"></div>
        </div>
        <div className="h-[106px]">
            <div className="w-full h-full border-4 border-black border-r-0"></div>
        </div>
        <div className="h-[106px]">
            <div className="w-full h-full border-4 rounded-full border-black"></div>
        </div>
        <div className="h-[106px] bg-gray-300 flex">
            <div className="w-[10rem] h-1 bg-black my-auto origin-center -rotate-45"></div>
        </div>
        <div className="h-[106px] bg-gray-300">5</div>
        <div className="h-[106px]">
            <div className="w-full h-full border-4 border-t-0 border-l-0 border-black"></div>
        </div>
      </div>
    </div>
  );
};

export default App;
